To decide if S ⇒* t53 t81 t82 t53 t65 t95, we run the CYK algorithm.  Briefly:

1.  Fill length‐1 cells by which NT ⇒ terminal:

    (1) t53 → {NT10}  
    (2) t81 → {NT3}  
    (3) t82 → {NT5, NT15, NT13}  
    (4) t53 → {NT10}  
    (5) t65 → {NT4, NT20, NT15}  
    (6) t95 → {NT12}

2.  Compute length‐2, 3, …, 6 cells.  In particular one finds

    • DP[1..2] = {NT20}  
    • DP[3..4] = {NT11}  
    • DP[4..5] = {NT9}  
    • DP[3..5] = {NT19, NT4}  
    • DP[4..6] = {S}  
    • DP[1..4] = {NT0}  
    • DP[1..5] = {NT9}  
    • DP[1..6] = {S}

Since S ∈ DP[1..6], the start symbol derives the entire string.

